import { setMovies } from '../slice/movieSlice/movieSlice';
import { useDispatch} from 'react-redux';

const dispatch = useDispatch();

export const getwatchlist = (value1,value2) => {
  const data = value1.filter((movie) => movie.id in value2);
  dispatch(setMovies(data));
};
